        public static class FormSwitcher
        {
         public static void SwitchMainForm (Form Form1, Form Form2)
            {
                Form1.Hide();
                Form2.Show();
                Form2.FormClosed += (s, args) => Form1.Show();
            }
        }
        public static void SwitchMainForm1(Form Form1, Form Form3)
        {
            Form1.Hide();
            Form3.Show();
            Form3.FormClosed += (s, args) => Form1.Show();
        }
    

